import React, { useEffect, useState } from 'react';
import './wishlist.css';

const Wishlist = () => {

    const [testArray, setTestArray] = useState([]);
    const [filteredTestArray, setFilteredTestArray] = useState([]);

    useEffect(() => {
        fetch('./products.json')
            .then(response => response.json())
            .then(data => {
                const array = data.map(product => product);
                setTestArray(array);
                setFilteredTestArray(array.slice(0, 6));
            })
            .catch(error => console.error('Error fetching products:', error));
    }, []);

    return (
        <div className='temp-palelime-bg'>
            <h1>WISHLIST</h1>
            <div>
                <div>
                    {filteredTestArray.length > 0 ? (
                        filteredTestArray.map((product, index) => (
                            <div key={index} className='layout-wishlist'>
                                <li>
                                    <div className='wishlist-container'>
                                        <img src={product.imageURL} alt='' />
                                    </div>
                                    <h2>{product.productName}</h2>
                                    <p>{product.productDescription}</p>
                                    <p>Add to Wishlist for quotation</p>
                                    <button>Add to Wishlist</button>
                                </li>
                            </div>
                        ))
                    ) : (
                        <p>No results found.</p>
                    )}
                </div>
            </div>
        </div>
    )
}

